var http = require('http');
var timeout = require('request-timeout');
var _    = require('underscore');
var episodes ;

var onreq = function (req, res)
{
    timeout(req, res, 30)

    if(req.method == 'POST')
    {
        var body = '';
        req.on('data', function (data)
        {
            body += data;

        });

        req.on('end', function ()

        {

            try{
                episodes = JSON.parse(body);
            }catch(e){
                episodes = null;
            }

            if(_.isObject(episodes) && episodes.hasOwnProperty('payload')){

                var filteredEpisodes = [];
                _.each(episodes.payload, function(i) {
                    if((i.drm === true) && (i.episodeCount > 0)){
                        var iObj = {};
                        iObj.image = i.image.showImage;
                        iObj.slug = i.slug;
                        iObj.title = i.title;
                        //filteredEpisodes.push(_.pick(i, 'image', 'slug', 'title'));
                        filteredEpisodes.push(iObj);
                    }
                });
                res.writeHead(200, {'Content-Type': 'application/json' });
                res.end(JSON.stringify({'response':filteredEpisodes}, null, 3));
            }else{
                res.writeHead(400, {'Content-Type': 'application/json' });
                res.end(JSON.stringify({'error': 'Could not decode request: JSON parsing failed'}));
            }

        });

        req.on('timeout', function() {
          console.log('The request timed out')
          res.end('The request timed out')
        });

        req.on('error', function(e) {
          res.writeHead(400, {'Content-Type': 'application/json' });
          res.end(JSON.stringify({'error': 'Could not decode request: JSON parsing failed'}));

        });

    }else{

        res.writeHead(400, {'Content-Type': 'application/json'});
        res.end(JSON.stringify({'error': 'No Post Occurred, Please Try again!'}));
    }
}
var port = process.env.PORT || 3000;
var server = http.createServer(onreq).listen(port);
console.log("listening on port " + port);

request-timeout
===============

Http request timeout for Node

### Installation

    npm install request-timeout

### Usage

    var timeout = require('request-timeout')
    var http = require('http')

    var server = http.createServer(handleRequest)

    function handleRequest(req, res) {
      timeout(req, res, 60) // set timeout to 60 seconds (default is 20)

      req.on('timeout', function() {
        console.log('The request timed out')
        res.end('The request timed out')
      })
    }

    server.listen(1137)

var request = require('request')
var http = require('http')
var timeout = require('./index')
var PORT = process.env.PORT || 1137

var server = http.createServer(handleRequest)

function handleRequest(req, res) {
  timeout(req, res, 2)

  req.once('timeout', handleTimeout)
}

function wait(seconds, cb) {
  var args = Array.prototype.slice.call(arguments, 2)
  setTimeout(function() {
    cb.apply(this, args)
  }, seconds * 1000)
}

function handleTimeout(req, res) {
  console.log('Timeout expired correctly')
  req.timeout.start(2)
  wait(1, cancelTimeout, req, res)
}

function cancelTimeout(req, res) {
  req.timeout.clear()
  req.once('timeout', function() { console.error('Timeout expired after it was cancelled') })
  wait(2, done, req, res)
}

function done(req, res) {
  console.log('Timeout cancelled successfully')
  console.log('All tests passed')
  res.end()
}

server.listen(PORT, function() {
  req()
})

function req() {
  request.get('http://localhost:' + PORT, function() { server.close() })
}

